	 ('ffd71afe-6ae0-4f49-b767-e324e65069d6','en_IN','UNDERTAKING_POINT7','7. I will not take the dog to the area of the Sukhna Lake, Rose Garden, Shanti Kunj,
                                    Rock Garden, Leisure Vallay, Mini Rose Garden, Fragrance Garden, Terrace Garden,
                                    Shivalik Garden and other public places/ gardens as specified by the Commissioner,
                                    Municipal Corporation Chandigarh from time to time.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d7','en_IN','UNDERTAKING_POINT8','8. I shall keep the dog under my control all the times, so that it does not intimidate, annoy, hurt or bite any person. I shall not make Municipal Corporation responsible for any loss, damage or injury caused by a registered dog to any person or to his/her property and sole liability to compensate the victim will remain with me.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d8','en_IN','UNDERTAKING_POINT9','9. I shall not indulge in breeding of dogs for commercial purposes and trading of dogs within the area of Municipal Corporation. In case it is found that dog is being kept for breeding or trading/commercial purposes by me, the Registration Authority shall impound my dog/s besides imposing a fine as fixed by the Commissioner, Municipal Corporation, Chandigarh upon me.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL),
	 ('ffd71afe-6ae0-4f49-b767-e324e65069d9','en_IN','UNDERTAKING_POINT10','10. I shall not allow the dog to defecate in public places such as residential areas,green belts, parks, streets, roads, road berms and other common places etc. In case the dog defecates at the above specified places, I shall arrange to get the excreta of the dog removed from the said place at my own level.','ch','rainmaker-pm',24226,'2019-03-25 13:55:25.827',NULL,NULL);
